    document.querySelectorAll('i').forEach((icon, index) => {
      icon.addEventListener('click', () => {
        const code = iconCodes[index];
        navigator.clipboard.writeText(code).then(() => {
          alert('Code copied to clipboard: ' + code);
        }).catch(err => {
          console.error('Error copying text: ', err);
        });
      });
    });

    // Filter icons based on search input
    document.getElementById('search').addEventListener('input', function() {
      const searchTerm = this.value.toLowerCase();
      document.querySelectorAll('#icon-container i').forEach(icon => {
        const iconClass = icon.className.toLowerCase();
        if (iconClass.includes(searchTerm)) {
          icon.classList.remove('hidden'); // Show icon if it matches
        } else {
          icon.classList.add('hidden'); // Hide icon if it doesn't match
        }
      });
    });
